oracleio.entry:
Vaardigheid, diplomatie, adres, subtiliteit; ziekte, pijn,
verlies, ramp, strikken van vijanden; het zelfvertrouwen, zal; 
Querent, als mannetje.

Geheimen, geheimzinnigheid, de unrevealed toekomst tot hiertoe; 
de vrouw die Querent, als mannetje interesseert; Querent 
zelf, als wijfje; stilte, hardnekkigheid; 
geheimzinnigheid, wijsheid, wetenschap.

Productiviteit, actie, initiatief, lengte van dagen; 
onbekend, heimelijk; ook moeilijkheid, twijfel, 
onwetendheid.

Eind, mortaliteit, vernietiging, corruptie ook, voor een man, 
het verlies van een weldoener voor een vrouw, vele contrarieties; 
voor een meisje, mislukking van huwelijksprojecten.

Eerlijke jonge mens, één aangespoord om de dienst en terug te 
geven met wie Querent zal worden verbonden; de studious jeugd; 
nieuws, bericht; toepassing, bezinning, meditatie; 
ook deze dingen die aan zaken worden geleid.

Van om het even welke aard te kennen gegeven door het ontwerp; 
ook pijn, kwelling, scheuren, droefheid, verlatenheid. Het
is vooral geen kaart van hevige dood.
